FRAME_DURATIONS = [
    200, 200, 200, 200
]


def show_frame(frame_data):
    # Create the bitmap and palette
    bitmap = displayio.Bitmap(64, 32, 65535)
    palette = displayio.Palette(65535)
    
    # Fill the palette with all possible RGB values
    for i in range(65535):
        r = ((i >> 11) & 0x1F) << 3
        g = ((i >> 5) & 0x3F) << 2
        b = (i & 0x1F) << 3
        palette[i] = (r << 16) | (g << 8) | b
    
    # Set bitmap pixels
    for y in range(32):
        for x in range(64):
            color = frame_data[y][x]
            bitmap[x, y] = color
    
    # Create and display the tile grid
    tile_grid = displayio.TileGrid(bitmap, pixel_shader=palette)
    group = displayio.Group()
    group.append(tile_grid)
    display.root_group = group

def main():
    frame_idx = 0
    while True:
        show_frame(FRAME_DATA[frame_idx])
        time.sleep(FRAME_DURATIONS[frame_idx] / 1000.0)
        frame_idx = (frame_idx + 1) % len(FRAME_DATA)

if __name__ == "__main__":
    main()
